css:
@-moz-document url(https://www.icy-veins.com) {
    body { background-image: none; background-color: #000; }
    #header, #header.minified { background-image: none; }
    #nav { background-color: #222; }
    .nav_entry:hover, .nav_entry.nav_entry_active { background-color: #333; }
    #nav .nav_content { background-color: #333; }
    #main.design_new_toc .page_title, .toc_page_list, .internal_links_block h3 { background-image: none; }
    .background { background-color: #111; }
    .toc_page_content { background-image: none; background-color: #000; }
    .page_content table tr:nth-child(2n) { background-color: #1A1A1A; }
    .page_content table tr:nth-child(2n+1),
    .page_content table th { background-color: #333; }
    .page_content_header { background-image: none !important; }
}
